(11, 5, 'Welcome to my profile.....', '\"Embark on your coding journey with the curiosity of a seeker, the determination of a warrior, and the patience of a craftsman. Every line of code you write is a step towards shaping the future you envision. Embrace the challenges, celebrate the victories, and remember, with each keystroke, you\'re crafting something remarkable.\"', 0, '2024-02-23 14:30:26', 0, '', ''),
