(18, 2, 'Bubble sort and Binary search algorithm code', '#include &lt;stdio.h&gt;\r\n#include &lt;conio.h&gt;\r\nint main(){\r\nint arr[10], i, j, temp;\r\nint lr=0, up=9, search, found=0, mid;\r\nfor(i=0;i&lt;10;i++){\r\nprintf(&quot;Enter element number %d:&quot;, i);\r\nscanf(&quot;%d&quot;, &amp;arr[i]);\r\n}\r\nfor(i=0;i&lt;10;i++){\r\nfor(j=i+1;j&lt;10;j++){\r\nif(arr[j]&lt;arr[i]){\r\ntemp = arr[i];\r\narr[i] = arr[j];\r\narr[j] = temp;\r\n}\r\n}\r\n}\r\nprintf(&quot;Sorted elements are here...\r\n&quot;);\r\nfor(i=0;i&lt;10;i++){\r\nprintf(&quot;Element at index %d is %d\r\n&quot;, i, arr[i]);\r\n}\r\n\r\nprintf(&quot;Enter the element you want to search: &quot;);\r\nscanf(&quot;%d&quot;, &amp;search);\r\nwhile(lr&lt;=up){\r\nmid = (lr+up)/2;\r\nif(arr[mid]==search){\r\nfound = 1;\r\nbreak;\r\n}\r\nelse if(arr[mid]&lt;search){\r\nlr = mid + 1;\r\n}\r\nelse{\r\nup = mid - 1;\r\n}\r\n}\r\nif(found==1){\r\nprintf(&quot;Item found at index %d\r\n&quot;, mid);\r\n}\r\nelse{\r\nprintf(&quot;Item not found in the given array\r\n&quot;);\r\n}\r\ngetch();\r\nreturn 0;\r\n}', 0, '2024-02-27 07:52:43', 0, '', ''),
