(31, 2, 'Insertion sort algorithm and Selection sort algorithm', 'Insertion sort algorithm\r\n#include&lt;stdio.h&gt;\r\n#include&lt;conio.h&gt;\r\nvoid main(){\r\n	int i, temp, j, a[]={10, 30, 20, 50, 40};\r\n	for(i=1;i&lt;5;i++){\r\n	j=i;\r\n		while(j&gt;=1){\r\n			if(a[j-1]&gt;a[j]){\r\n			temp=a[j-1];\r\n			a[j-1]=a[j];\r\n			a[j]=temp;\r\n			}\r\n			j=j-1;\r\n		}\r\n	}\r\n	for(i=0;i&lt;5;i++){\r\n	printf(&quot;Value of a[%d]=%d\\n&quot;, i, a[i]);\r\n	}\r\n	getch();\r\n}\r\n\r\nSelection sort algorithm\r\n#include&lt;stdio.h&gt;\r\n#include&lt;conio.h&gt;\r\nvoid main() {\r\n int a[]={10, 30, 20, 50, 40};\r\n int small, j, i, temp;\r\n for(i = 0;i&lt; 4; i++){\r\n small = i;\r\n j = i+1;\r\n	while(j&lt;5){\r\n	 if(a[j]&lt;a[small]){\r\n	 small = j;\r\n	 temp = a[small];\r\n	 a[small] = a[i];\r\n	 a[i] = temp;\r\n	 }\r\n	 j+=1;\r\n	}\r\n }\r\n printf(&quot;Array after sorting...\\n&quot;);\r\n for(i=0;i&lt;5;i++){\r\n printf(&quot;Value of a[%d]=%d\\n&quot;, i, a[i]);\r\n }\r\n getch();\r\n}', 0, '2024-03-04 06:47:31', 0, '', ''),
